window.bookSummaryJSON = "<p><b>The explosive finale to the </b><b><i>New York Times </i></b><b>and </b><b><i>USA Today </i></b><b>best-selling Shatter Me series.</b></p> <p>Juliette Ferrars. </p> <p>Ella Sommers.</p> <p>Which is the truth and which is the lie? </p> <p>Now that Ella knows who Juliette is and what she was created for, things have only become more complicated. As she struggles to understand the past that haunts her and looks to a future more uncertain than ever, the lines between right and wrong - between Ella and Juliette - blur. And with old enemies looming, her destiny may not be her own to control.</p> <p>The day of reckoning for the Reestablishment is coming. But she may not get to choose what side she fights on.</p>"; 
